import LeftPortCol from "./LeftPortCol";
import RightPortCol from "./RightPortCol";

const PortfolioMainPage = (props) => {
    return(
        <div>
            <LeftPortCol finalDownerArr={props.finalDownerArr} toggleActivePortfolioLeft={props.toggleActivePortfolioLeft}/>
            <RightPortCol finalUpperArr={props.finalUpperArr} toggleActiveUpper={props.toggleActiveUpper}/>
        </div>
    )
}

export default PortfolioMainPage;

